import React from "react";
import { work } from "../../data/work";

export const Work = () => {
  return (
    <div className="mt-32 pb-10">
      <h1 className="text-6xl font-bold">My Work</h1>
      {work.map((w) => (
        <div>
          <div className="w-1/3">
            <h1>{w.name}</h1>
          </div>
          <div className="w-2/3"></div>
        </div>
      ))}
    </div>
  );
};
